import React from "react";
import "./work.css";
import Card from "./Card.jsx";

const Data = [
  {
    id: 1,
    category: "education",
    icon: "icon-graduation",
    year: "NOV 19 - APR 21",
    title: "Master of Information Technology",
    desc: "University of Sydney",
  },
  {
    id: 2,
    category: "education",
    icon: "icon-graduation",
    year: "FEB 19 - NOV 19",
    title: "Graduate Diploma in Information Technology",
    desc: "University of Sydney",
  },
  {
    id: 3,
    category: "experience",
    icon: "icon-briefcase",
    year: "MAY 22 - Current",
    title: "Website Developer",
    desc: "the Social Media Network",
  },
  {
    id: 4,
    category: "experience",
    icon: "icon-briefcase",
    year: "SEP 21 - FEB 22",
    title: "Website Developer",
    desc: "Tech Creative Partner",
  },
];

const Work = () => {
  return (
    <section className="about container section" id="experience">
      <h2 className="section-title">- Experience</h2>
      <div className="work-container grid">
        <div className="timeline grid">
          {Data.map((val, id) => {
            if (val.category === "education") {
              return (
                <Card
                  key={id}
                  icon={val.icon}
                  title={val.title}
                  year={val.year}
                  desc={val.desc}
                />
              );
            }
          })}
        </div>

        <div className="timeline grid">
          {Data.map((val, index) => {
            if (val.category === "experience") {
              return (
                <Card
                  key={index}
                  icon={val.icon}
                  title={val.title}
                  year={val.year}
                  desc={val.desc}
                />
              );
            }
          })}
        </div>
      </div>
    </section>
  );
};

export default Work;
